import ReactDOM  from "react-dom";
import React, {useState} from "react";


function App() {
    // var count = 0;
    const {count}= React.useState(43);
    console.log(count);

    // const [red ,green,blue] = [3,5,22];
    // console.log(blue);
    function increase() {
        // count++;
        ReactDOM.render( <div>
            <button>{count}</button>
            <button onClick={increase}>+</button>
        </div>,
            document.getElementById("root"));
    }
    return (
        <div>
            <button>{count}</button>
            <button onClick={increase}>+</button>
        </div>
    )

}




export default App;
